from PIL import Image

pic = Image.new("RGB",(1344, 840))
str = ""
i=0
for y in range (0,840):
    for x in range (0,1344):
        if(str[i] == '1'):
            pic.putpixel([x,y],(0, 0, 0))
        else:
            pic.putpixel([x,y],(255,255,255))
        i = i+1
# pic.show()
pic.save("flag.png")
